angular.module('contactos.services', [])

    .constant('AvatarImg', '')

    .factory('ContactosService', function() {

        var vm = this;

        // Some fake testing data
        var fakeContacts = [
            { nombre: 'Xavi', apellido: 'Corral Cabús', comentarios: 'Profesor', id: 1 },
            { nombre: 'Oriol', apellido: 'Blas Guinovart', comentarios: 'Coordinador', id: 2 },
            { nombre: 'Esteve', apellido: 'Escolà', comentarios: 'Alumno', id: 3 }
        ];

        var indexContactos = 0;

        var metodos = {

            all: function () {
                var listaContactos = window.localStorage['contactos'];

                if(typeof listaContactos !== 'undefined') {
                    return angular.fromJson(listaContactos)
                } else {
                    console.log('no contacts yet...');
                    this.save(fakeContacts);
                    indexContactos = fakeContacts.length + 1;
                    return fakeContacts;
                }
            },

            get: function (contactoId) {
                var listaContactos = this.all();
                for(var i=0; i < listaContactos.length; i++) {
                    if (listaContactos[i].id == contactoId) {
                        return listaContactos[i];
                    }
                }
            },

            save: function (listaContactos) {
                window.localStorage['contactos'] = angular.toJson(listaContactos);
            },

            add: function (contacto) {
                var listaContactos = this.all();
                contacto.id = indexContactos++;
                listaContactos.push(contacto);
                this.save(listaContactos);
            },

            delete: function (contactoId) {
                var listaContactos = this.all();
                var i;
                for(i=0; i < listaContactos.length; i++) {
                    if (listaContactos[i].id == contactoId) {
                        listaContactos.splice(i, 1);
                    }
                }
                this.save(listaContactos);
            },

            getIndexContactos: function() {
                return indexContactos;
            }

        }

        return metodos;
    })

    .factory('CameraService', function($q, AvatarImg) {
        var metodos = {

            getPicture: function () {
                console.log('getting picture');
                var deferred = $q.defer();

                if (navigator.camera) {
                    console.log('contactos: ' + navigator.camera);
                    var options = {
                        quality: 50,
                        destinationType: Camera.DestinationType.DATA_URL,
                        sourceType: Camera.PictureSourceType.CAMERA,
                        encodingType: Camera.EncodingType.PNG,
                        //mediaType: Camera.MediaType.PICTURE,
                        targetWidth: 300,
                        targetHeight: 300,
                        allowEdit: true,
                        correctOrientation: true  //Corrects Android orientation quirks
                    };
                    console.log('contactos: ' + options);

                    navigator.camera.getPicture(
                        function (imageData) {
                            console.log('contactos: ' + 'foto taken');
                            console.log('contactos imageData:' + imageData);
                            deferred.resolve("data:image/png;base64, " + imageData);
                        },
                        function (error) {
                            console.log('contactos: foto error');
                            console.log('contactos: ' + error);
                            deferred.reject(error);
                        },
                        options
                    );
                } else {
                    // fake photo
                    console.log('contactos: taking fake photo');
                    deferred.resolve("data:image/png;base64," + AvatarImg);
                }

                return deferred.promise;
            }

        }



        return metodos;
    })
;

